private void initCannedAcls(Configuration conf) {
  String cannedACLName = conf.get(CANNED_ACL, DEFAULT_CANNED_ACL);
  if (!cannedACLName.isEmpty()) {
    cannedACL = CannedAccessControlList.valueOf(cannedACLName);
  } else {
    cannedACL = null;
  }
}
